import React from "react";
import Navigation from './navigation';
import '../css/main.css';
import AboutCard from './AboutCard';
import styled  from "styled-components";

const Header = styled.h1`
    padding-top: 2vh;
    text-align: center;
    font-size: 50px;
`;

function About(){
    return(
        <div>
            <Navigation/>
            <Header>About Me</Header>
            <AboutCard/>
        </div>
    );
}

export default About;
